def __buildFortunePaths(node, ladderName):
    if isinstance(node, QuestDNA):
        FortunePathHelperDict[node.getQuestId()] = ladderName
        return None

    for ladder in node.getContainers():
        __buildFortunePaths(ladder, ladderName)



