def getQuestInts(ladder):
    questInts = [
        ladder.getQuestInt()]
    if hasattr(ladder, 'getContainers'):
        containers = ladder.getContainers()
        if containers:
            for container in containers:
                ints = getQuestInts(container)
                for int in ints:
                    questInts.append(int)




    return questInts


